    //to get the row data onclick of edit 
    LessonScheduleComponent.prototype.editlesson = function (editElement) {
        var _this = this;
        var year;
        var month;
        var day;
        // $('#lesson').removeAttr("disabled");
        var status = editElement.getAttribute('lessschedulestatus');
        if (status == '1') {
            this.title1 = "Edit Portion to be Covered";
            this.bloom_update.length = 0;
            this.mtd_id_update.length = 0;
            var lessonscheduleId = editElement.getAttribute('lessonscheduleId');
            var lessonscheduleStartdate = editElement.getAttribute('lessonscheduleStartdate');
            if (lessonscheduleStartdate == "") {
            }
            else {
                year = lessonscheduleStartdate.substring(0, 4);
                month = lessonscheduleStartdate.substring(5, 7);
                day = lessonscheduleStartdate.substring(8, 10);
                var initial_day = day.replace(/^0+/, '');
                var initial_month = month.replace(/^0+/, '');
                this.model = { date: { year: year, month: initial_month, day: initial_day } };
            }
            var lessonschedulecompletiondate = editElement.getAttribute('lessonschedulecompletiondate');
            if (lessonschedulecompletiondate == "") {
                this.completionDate.reset();
                // let formatted_date = year+'-'+month+'-'+day;
                // this.checkDate(formatted_date)
                // this.model1=null
            }
            else {
                var year1 = lessonschedulecompletiondate.substring(0, 4);
                var month1 = lessonschedulecompletiondate.substring(5, 7);
                var day1 = lessonschedulecompletiondate.substring(8, 10);
                var due_day = day1.replace(/^0+/, '');
                var due_month = month1.replace(/^0+/, '');
                this.model1 = { date: { year: year1, month: due_month, day: due_day } };
            }
            this.service.subUrl = 'lesson_schedule/LessonSchedule/geteditlessonSchedule';
            this.service.createPost(lessonscheduleId).subscribe(function (response) {
                _this.lessonScheduleEditData = response.json();
                _this.lessonScheduleEditData.forEach(function (element) {
                    _this.setLessonScheduleId = element.lsn_sch_id;
                    var slno = element.slno;
                    var portion_per_hour = element.portion_per_hour;
                    _this.status = element.status;
                    if (element.bloom != undefined) {
                        element.bloom.forEach(function (data) {
                            if (_this.bloom_update.indexOf(data) == -1) {
                                _this.bloom_update.push(data);
                            }
                        });
                    }
                    if (element.method != undefined) {
                        element.method.forEach(function (data1) {
                            if (_this.mtd_id_update.indexOf(data1) == -1) {
                                _this.mtd_id_update.push(data1);
                            }
                        });
                    }
                    _this.lesson.setValue(slno);
                    _this.portion.setValue(portion_per_hour);
                    _this.actualStartDate.setValue(_this.model);
                    _this.completionDate.setValue(_this.model1);
                    _this.deliveryMethod.setValue(_this.mtd_id_update);
                    _this.bloom.setValue(_this.bloom_update);
                });
            });
            this.isSaveHide = true;
            this.isUpdateHide = false;
        }
        else {
            if (status == '0') {
                // $('#lesson').attr("disabled", "disabled");
                var type = 'error';
                var title = 'Edit Fail';
                var body = 'Lesson Schedule- Portion to be covered is not initialised, so in order to mention mapping, start date and end date please initiate portion to be covered by clicking on Not Initiated button';
                this.toasterMsg(type, title, body);
            }
            else {
                // $('#lesson').attr("disabled", "disabled");
                var type = 'error';
                var title = 'Edit Fail';
                var body = 'Since lesson portion is completed. You can not edit';
                this.toasterMsg(type, title, body);
            }
        }
    };
